  false,\n\t\"url\": null,\n\t\"notes\": \"A fish survey of the following Carolina
  Sandhills NWR impoundments; Pool L, Lake Bee, Lake 16, Pool G, Mays Lake, Oxpen
  1, was conducted in late September of 2004. The purpose of this initial fish survey
  was to gather data to provide a relative abundance estimate of the present refuge
  fish populations and to develop management recommendations for refuge staff. These
  impoundments were selected because of their popular public usage and accessibility.\",\n\t\"license_title\":
